When Kani builds your code, it does two important things: It sets cfg(kani). It injects the kani crate. A proof harness (which you can learn more about in the tutorial ), is a function annotated with #[kani::proof] much like a test is annotated with #[test]. But you may experience a similar problem using Kani as you would with dev-dependencies: if you try writing #[kani::proof] directly in your code, cargo build will fail because it doesn't know what the kani crate is. This is why we recommend the same conventions as are used when writing tests in Rust: wrap your proof harnesses in cfg(kani) conditional compilation: #[cfg(kani)]
mod verification { use super::*; #[kani::proof] pub fn check_something() { // .... }
} This will ensure that a normal build of your code will be completely unaffected by anything Kani-related. This conditional compilation with cfg(kani) (as seen above) is still required for Kani proofs placed under tests/. When this code is built by cargo test, the kani crate is not available, and so it would otherwise cause build failures. (Whereas the use of dev-dependencies under tests/ does not need to be gated with cfg(test) since that code is already only built when testing.)

