The result (or Status) of a check in Kani can be one of the following: SUCCESS: This indicates that the check passed (i.e., the property holds). Note that in some cases, the property may hold vacuously . This can occur because the property is unreachable, or because the harness is over-constrained . Example: fn success_example() { let mut sum = 0; for i in 1..4 { sum += i; } assert_eq!(sum, 6);
} The output from Kani indicates that the assertion holds: Check 4: success_example.assertion.4 - Status: SUCCESS - Description: "assertion failed: sum == 6" FAILURE: This indicates that the check failed (i.e., the property doesn't hold). In this case, please see the debugging verification failures section for more help. Example: fn failure_example() { let arr = [1, 2, 3]; assert_ne!(arr.len(), 3);
} The assertion doesn't hold as Kani's output indicates: Check 2: failure_example.assertion.2 - Status: FAILURE - Description: "assertion failed: arr.len() != 3" UNREACHABLE: This indicates that the check is unreachable (i.e., the property holds vacuously ). This occurs when there is no possible execution trace that can reach the check's line of code. This may be because the function that contains the check is unused, or because the harness does not trigger the condition under which the check is invoked. Kani currently checks reachability for the following assertion types: Assert macros (e.g. assert, assert_eq, etc.) Arithmetic overflow checks Negation overflow checks Index out-of-bounds checks Divide/remainder-by-zero checks Example: fn unreachable_example() { let x = 5; let y = x + 2; if x > y { assert!(x < 8); }
} The output from Kani indicates that the assertion is unreachable: Check 2: unreachable_example.assertion.2 - Status: UNREACHABLE - Description: "assertion failed: x < 8" UNDETERMINED: This indicates that Kani was not able to conclude whether the property holds or not. This can occur when the Rust program contains a construct that is not currently supported by Kani. See Rust feature support for Kani's current support of the Rust language features. Example: fn undetermined_example() { let mut x = 0; unsupp(&mut x); assert!(x == 0);
} #[feature(asm)]
fn unsupp(x: &mut u8) { unsafe { std::arch::asm!("nop"); }
} The output from Kani indicates that the assertion is undetermined due to the missing support for inline assembly in Kani: Check 2: undetermined_example.assertion.2 - Status: UNDETERMINED - Description: "assertion failed: x == 0"

