Kani provides a kani::cover macro that can be used for checking whether a condition may occur at a certain point in the code. The result of a cover property can be one of the following: SATISFIED: This indicates that Kani found an execution that triggers the specified condition. The following example uses kani::cover to check if it's possible for x and y to hold the values 24 and 72, respectively, after 3 iterations of the while loop, which turns out to be the case. #[kani::unwind(256)]
fn cover_satisfied_example() { let mut x: u8 = kani::any(); let mut y: u8 = kani::any(); y /= 2; let mut i = 0; while x != 0 && y != 0 { kani::cover!(i > 2 && x == 24 && y == 72); if x >= y { x -= y; } else { y -= x; } i += 1; }
} Results: Check 1: cover_satisfied_example.cover.1 - Status: SATISFIED - Description: "cover condition: i > 2 && x == 24 && y == 72" - Location: src/main.rs:60:9 in function cover_satisfied_example UNSATISFIABLE: This indicates that Kani proved that the specified condition is impossible. The following example uses kani::cover to check if it's possible to have a UTF-8 encoded string consisting of 5 bytes that correspond to a string with a single character. #[kani::unwind(6)]
