} Check 3: cover_unreachable_example.cover.1 - Status: UNREACHABLE - Description: "cover condition: r2.contains(&0)" - Location: src/main.rs:90:13 in function cover_unreachable_example UNDETERMINED: This is the same as the UNDETERMINED result for normal checks (see [check_results]).

