#[kani::unwind(1)] // deliberately too low
fn check_initialize_prefix() { const LIMIT: usize = 10; let mut buffer: [u8; LIMIT] = [1; LIMIT]; let length = kani::any(); kani::assume(length <= LIMIT); initialize_prefix(length, &mut buffer);
} But we've just used a new feature (#[kani::unwind(1)]) that requires some explanation. When we run cargo kani on this code as we have written it, we see an odd verification failure: SUMMARY: ** 1 of 67 failed (66 undetermined)
Failed Checks: unwinding assertion loop 0 VERIFICATION:- FAILED If we try removing this "unwind" annotation and re-running Kani, the result is worse: non-termination. Kani simply doesn't produce a result. The problem we're struggling with is the technique Kani uses to verify code. We're not able to handle code with "unbounded" loops, and what "bounded" means can be quite subtle. It has to have a constant number of iterations that's "obviously constant" enough for the verifier to actually figure this out. In practice, very few loops are like this. To verify programs like this with Kani as it exists today, we need to do two things: Set an upper bound on the size of the problem. We've actually already done part of this: our proof harness above seems to be trying to set an upper LIMIT of 10. Tell Kani about this limit if (or when) it's not able to figure it out on its own. This is the purpose of the kani::unwind annotation. Bounding proofs like this means we may no longer be proving as much as we originally hoped. Who's to say, if we prove everything works up to size 10, that there isn't a novel bug lurking, reachable only with problems of size 11+? Perhaps! But, let's get back to the issue at hand. By putting #[kani::unwind(1)] on the proof harness, we've placed an upper bound of 1 loop iteration. The "unwinding assertion" failure that Kani reports is because this bound is not high enough. The code tries to execute more than 1 loop iteration. (And, because the unwinding isn't high enough, many of the other properties Kani is verifying become "undetermined": we don't really know if they're true or false, because we can't get far enough.) Exercise : Try increasing the bound. Where might you start? How high do you need to go to get rid of the "unwinding assertion" failure? Click to see explanation for the exercise Since the proof harness is trying to limit the array to size 10, an initial unwind value of 10 seems like the obvious place to start. But that's not large enough for Kani, and we still see the "unwinding assertion" failure. At size 11, the "unwinding assertion" goes away, and now we can see the actual failure we're trying to find too. We'll explain why we see this behavior in a moment. Once we have increased the unwinding limit high enough, we're left with these failures: SUMMARY: ** 1 of 68 failed
Failed Checks: index out of bounds: the length is less than or equal to the given index File: "./src/lib.rs", line 12, in initialize_prefix VERIFICATION:- FAILED Exercise : Fix the off-by-one error, and get the (bounded) proof to go through. We now return to the question: why is 11 the unwinding bound? Kani needs the unwinding bound to be "one more than" the number of loop iterations. We previously had an off-by-one error that tried to do 11 iterations on an array of size 10. So... the unwinding bound needed to be 11, then. NOTE : Presently, there are some situations where "number of iterations of a loop" can be less obvious than it seems. This can be easily triggered with use of break or continue within loops. Often this manifests itself as needing "two more" or "three more" iterations in the unwind bound than seems like it would actually run. In those situations, we might still need a bound like kani::unwind(13), despite looking like a loop bounded to 10 iterations. The approach we've taken here is a general method for getting a bounded proof to go through: Put an actual upper bound on the problem itself. Here that's accomplished via LIMIT in our proof harness. We don't create a slice any bigger than that, and that's what we loop over. Start at a reasonable guess for a kani::unwind bound, and increase until the unwinding assertion failure goes away. Or, if that starts to take too long to verify, decrease your problem's bound, to accommodate the verifier's performance.

