Let's say you're developing an inventory management tool, and you would like to start verifying properties about your API. Here is a simple example (available here ): use std::num::NonZeroU32;
use vector_map::VecMap; pub type ProductId = u32; pub struct Inventory { /// Every product in inventory must have a non-zero quantity pub inner: VecMap<ProductId, NonZeroU32>,
} impl Inventory { pub fn update(&mut self, id: ProductId, new_quantity: NonZeroU32) { self.inner.insert(id, new_quantity); } pub fn get(&self, id: &ProductId) -> Option<NonZeroU32> { self.inner.get(id).cloned() }
} Let's write a fairly simple proof harness, one that just ensures we successfully get the value we inserted with update: #[kani::proof] #[kani::unwind(3)] pub fn safe_update() { // Empty to start let mut inventory = Inventory { inner: VecMap::new() }; // Create non-deterministic variables for id and quantity. let id: ProductId = kani::any(); let quantity: NonZeroU32 = kani::any(); assert!(quantity.get() != 0, "NonZeroU32 is internally a u32 but it should never be 0."); // Update the inventory and check the result. inventory.update(id, quantity); assert!(inventory.get(&id).unwrap() == quantity); } We use kani::any() twice here: id has type ProductId which was actually just a u32, and so any value is fine. quantity, however, has type NonZeroU32. In Rust, it would be undefined behavior to have a value of 0 for this type. We included an extra assertion that the value returned by kani::any() here was actually non-zero. If we run this, you'll notice that verification succeeds. cargo kani --harness safe_update kani::any() is safe Rust, and so Kani only implements it for types where type invariants are enforced. For NonZeroU32, this means we never return a 0 value. The assertion we wrote in this harness was just an extra check we added to demonstrate this fact, not an essential part of the proof.

