Support for stubbing is currently limited to functions and methods . All other items aren't supported. The following are examples of items that could be good candidates for stubbing, but aren't supported: Types Macros Traits Intrinsics We acknowledge that support for method stubbing isn't as ergonomic as it could be. A common problem when attempting to define method stubs is that we don't have access to the private fields of an object (i.e., the fields in self). One workaround is to use the unsafe function std::mem::transmute, as in this example: struct Foo { x: u32,
} impl Foo { pub fn m(&self) -> u32 { 0 }
} struct MockFoo { pub x: u32,
} fn mock_m(foo: &Foo) -> u32 { let mock: &MockFoo = unsafe { std::mem::transmute(foo) }; return mock.x;
} #[cfg(kani)]
#[kani::proof]
#[kani::stub(Foo::m, mock_m)]
fn my_harness() { ... } However, this isn't recommended since it's unsafe and error-prone. In general, we don't recommend stubbing for private functions/methods. Doing so can lead to brittle proofs: private functions/methods are subject to change or removal even in version minor upgrades (they aren't part of the APIs). Therefore, proofs that rely on stubbing for private functions/methods might incur a high maintenance burden.

