We consider a stub and a function/method to be compatible if all the following conditions are met: They have the same number of parameters. They have the same return type. Each parameter in the stub has the same type as the corresponding parameter in the original function/method. The stub must have the same number of generic parameters as the original function/method. However, a generic parameter in the stub is allowed to have a different name than the corresponding parameter in the original function/method. For example, the stub bar<A, B>(x: A, y: B) -> B is considered to have a type compatible with the function foo<S, T>(x: S, y: T) -> T. The bounds for each type parameter don't need to match; however, all calls to the original function must also satisfy the bounds of the stub. The final point is the most subtle. We don't require that a type parameter in the signature of the stub implements the same traits as the corresponding type parameter in the signature of the original function/method. However, Kani will reject a stub if a trait mismatch leads to a situation where a statically dispatched call to a trait method cannot be resolved during monomorphization. For example, this restriction rules out the following harness: fn foo<T>(_x: T) -> bool { false
} trait DoIt { fn do_it(&self) -> bool;
} fn bar<T: DoIt>(x: T) -> bool { x.do_it()
} #[kani::proof]
#[kani::stub(foo, bar)]
fn harness() { assert!(foo("hello"));
